    if(!(archivos[i]=fopen( numstr ,"w"))) 
    {
      printf("\nNo se pudo abrir el archivo %s", numstr);
      printf("\nEl numero maximo de archivos abiertos fue: %d", i);
      exit(1);
    }
  }

  printf("\nNo ocurrio un error. El numero de archivos abiertos es: %d\n", i);
  for( i=0; i<nmax; i++)
    fclose( archivos[i] ); 
  return( 0 );
}

